ww.jsdelivr.com/package/npm/to-number-x\"\n  title=\"jsDelivr hits\"\u003e\n\u003cimg src=\"https://data.jsdelivr.com/v1/package/npm/to-number-x/badge?style=rounded\"\n  alt=\"jsDelivr hits\" height=\"18\"\u003e\n\u003c/a\u003e\n\u003ca\n  href=\"https://bettercodehub.com/results/Xotic750/to-number-x\"\n  title=\"bettercodehub score\"\u003e\n\u003cimg src=\"https://bettercodehub.com/edge/badge/Xotic750/to-number-x?branch=master\"\n  alt=\"bettercodehub score\" height=\"18\"\u003e\n\u003c/a\u003e\n\u003ca\n  href=\"https://coveralls.io/github/Xotic750/to-number-x?branch=master\"\n  title=\"Coverage Status\"\u003e\n\u003cimg src=\"https://coveralls.io/repos/github/Xotic750/to-number-x/badge.svg?branch=master\"\n  alt=\"Coverage Status\" height=\"18\"\u003e\n\u003c/a\u003e\n\n\u003ca name=\"module_to-number-x\"\u003e\u003c/a\u003e\n\n## to-number-x\n\nConverts argument to a value of type Number.\n\n\u003ca name=\"exp_module_math-trim-x.exports\"\u003e\u003c/a\u003e\n\n### `module.exports(value)` ⇒ \u003ccode\u003e\\*\u003c/code\u003e ⏏\n\n\u003ca name=\"module_to-number-x\"\u003e\u003c/a\u003e\n\n### `to-number-x` ⇒ \u003ccode\u003e\\*\u003c/code\u003e\n\nThis method converts argument to a value of type Number. (ES2019)\n\n**Kind**: static property of [\u003ccode\u003eto-number-x\u003c/code\u003e](#module_to-number-x)  \n**Returns**: \u003ccode\u003e\\*\u003c/code\u003e - The argument converted to a number.  \n**Throws**:\n\n- \u003ccode\u003eTypeError\u003c/code\u003e - If argument is a Symbol or not coercible.\n\n| Param    | Type            | Description                          |\n| -------- | --------------- | ------------------------------------ |\n| argument | \u003ccode\u003e\\*\u003c/code\u003e | The argument to convert to a number. |\n\n**Example**\n\n```js\nimport toNumber from 'to-number-x';\n\nconsole.log(toNumber('1')); // 1\nconsole.log(toNumber(null)); // 0\nconsole.log(toNumber(true)); // 1\nconsole.log(toNumber('0o10')); // 8\nconsole.log(toNumber('0b10')); // 2\nconsole.log(toNumber('0xF')); // 16\n\nconsole.log(toNumber(' 1 ')); // 1\n\nconsole.log(toNumber(Symbol(''))); // TypeError\nconsole.log(toNumber(Object.create(null))); // TypeError\n```\n","homepage":"https://github.com/Xotic750/to-number-x","trustScore":13,"sourceRank":{"basic_info_present":1,"repository_present":1,"readme_present":1,"license_present":1,"versions_present":1,"follows_semver":1,"recent_release":0,"not_brand_new":1,"one_point_oh":1,"dependent_projects":2,"dependent_repositories":3,"stars":0,"contributors":0,"subscribers":0,"all_prereleases":0,"any_outdated_dependencies":0,"is_deprecated":0,"is_unmaintained":0,"is_removed":0,"trustScore":13},"versions":[{"versionNumber":"1.0.0","timestamp":"2017-08-28T19:25:24.103Z","trustScore":11,"dependencies":[{"packageName":"is-primitive","version":"^2.0.0"},{"packageName":"to-primitive-x","version":"^1.0.0"},{"packageName":"trim-x","version":"^1.0.2"}]},{"versionNumber":"1.0.1","timestamp":"2017-09-01T16:57:05.511Z","trustScore":14,"dependencies":[{"packageName":"to-primitive-x","version":"^1.0.1"},{"packageName":"trim-x","version":"^1.0.3"}]},{"versionNumber":"1.1.0","timestamp":"2017-09-03T15:59:35.107Z","trustScore":12,"dependencies":[{"packageName":"to-primitive-x","version":"^1.0.1"},{"packageName":"trim-x","version":"^1.0.3"}]},{"versionNumber":"1.2.0","timestamp":"2017-09-30T16:32:48.459Z","trustScore":13,"dependencies":[{"packageName":"cached-constructors-x","version":"^1.0.0"},{"packageName":"nan-x","version":"^1.0.0"},{"packageName":"parse-int-x","version":"^1.1.0"},{"packageName":"to-primitive-x","version":"^1.1.0"},{"packageName":"trim-x","version":"^2.0.2"}]},{"versionNumber":"2.0.0","timestamp":"2017-10-18T18:01:42.721Z","trustScore":14,"dependencies":[{"packageName":"cached-constructors-x","version":"^1.0.0"},{"packageName":"nan-x","version":"^1.0.0"},{"packageName":"parse-int-x","version":"^2.0.0"},{"packageName":"to-primitive-x","version":"^1.1.0"},{"packageName":"trim-x","version"
